Welcoming 2 new friends! I started this project just a couple of months ago, & it has already grown so much. I’m continually inspired by the strength and resilience of the entire LGBTQIA+ community, and spending time together like this is so healing.
‼️📣‼️We are looking for more cis allies - the ones behind the scenes, helping us help others understand us better. If you want to help out, but being on camera isn’t your thing, YES - you can help us! Send me a DM if you’re interested 🖤🖤
